import React, { usetState, useEffect } from "react";
import {
  Button,
  Form as FormStrap,
  FormGroup,
  Label,
  Input,
  FormText,
  Container,
  Row,
  Col
} from "reactstrap";

function Form(props) {
  return (
    <Container>
      <FormStrap>
        <FormGroup>
          <Label for="name">Name</Label>
          <Input id="name" type="text" />
        </FormGroup>
        <FormGroup>
          <Label for="email">Email</Label>
          <Input id="email" type="email" />
        </FormGroup>
        <FormGroup>
          <Label for="role">Role</Label>
          <Input id="role" type="text" />
        </FormGroup>
      </FormStrap>
    </Container>
  );
}

export default Form;
